import React, { useState } from 'react';
import Navigation from '../navigation/Navigation';
const Ajout = () => {
    const [valera, setaValera] = useState("")
    const makavalera = (e) => {
        setaValera(e.currentTarget.value)
    }
    return (
        <div>
            <h3>Page Ajout</h3>
            <Navigation />
            <form action="">
                <label htmlFor="">Nom</label><input type="text" value={valera} placeholder='ajouter client' />
                <br />
                <label htmlFor="">prenom</label><input type="text" placeholder='ajouter client' /><br />
                <button type="submit">Submit</button>

            </form>
            <p>{valera}</p>
        </div>
    );
};

export default Ajout;
